import React from "react"

const SignUp = React.forwardRef(({ style, ...rest }, ref) => {
    const styles = {
      ...style,
      background: 'white',
      width: "15rem",
      height: "20rem",
      padding: 20,
      borderRadius: 4,
      position: 'absolute',
      boxShadow: '0 3px 6px -2px rgba(0, 0, 0, 0.6)'
    };
    return (
      <div {...rest} style={styles} ref={ref}>
        Overlay
      </div>
    );
  });

export default SignUp
